BEGIN;
INSERT INTO `z_hum` VALUES ('六百多片北宋瓷片 讲述海上丝路故事', 'http://cms-bucket.nosdn.127.net/catchpic/9/9d/9de2184fcb8dd8de76d515fd536f1149.jpg', '近日上海博物馆发布了此次联合考古项目阶段性成果：考古队在阿莱皮蒂遗址共发掘92.4平方米，出土陶瓷器总计650多片，其中来自中国的瓷片超过600片，为认识海上丝绸之路、贸易文化交流提供了实物资料。\r\n\r\n中国与斯里兰卡有2000多年的交往历史，斯里兰卡在古代海上贸易中具有重要的地位。该联合考古队通过考古发掘、举办展览、人员交流等方式，共同研究斯里兰卡境内留下的反映海上丝绸之路的相关遗迹和遗物，探寻两国之间经济、文化与宗教的交流历史。', '2945b2b4765840dbaa9ba2d6f57b4ed8', '1', '2018-10-10 15:48:08', '1', '2018-10-10 15:48:08', '', '0'), ('剧场每月都在亏损 父女接力23年为汉剧迷坚守', 'http://cms-bucket.nosdn.127.net/catchpic/2/28/28a66942ac1d2e8da0cc63cd1c3a43cb.jpg', '4日，武汉黄鹤楼道上临街的小剧场内，20余位汉剧票友围桌而坐，或上台亮嗓、或捧茶品味。虽然这里离人潮汹涌的武昌临江大道不足百米，却用皮黄、锣鼓、胡琴织就一方令时光停驻的天地，恍若旧日。\r\n\r\n这就是江城汉剧迷中有名的民间剧场&ldquo;黄鹤楼汉剧阁&rdquo;，200平方米的剧场内舞台、乐队、化妆间俱全，来的人不仅有汉剧票友中的活跃人物，也有贾振南这样的汉剧名家，乐师也基本由专业剧团退休的人担任。花上5元茶钱，可以消磨整个下午，若有兴致也可上台清唱。', '3307fb21cb17473f89f33dcfbcf9bd3b', '1', '2018-10-10 15:47:28', '1', '2018-10-10 15:47:28', '', '0'), ('2.52亿年前，发生了最大的生物灭绝事件，是什么环境因素导致的呢？10月7日获悉，中国地质大学(武汉)谢树成教授团队的研究成果&ldquo;地质微生物记录了极端环境事件&rdquo;分析出了灭绝的环境因素。该成果已入选中国古生物学十大进展。', 'http://cms-bucket.nosdn.127.net/2018/10/10/0bea0c9dd646438891ad37cef6aa134a.jpeg', '谢树成介绍，地质微生物因处于生态系统食物链的底层而对气候环境变化相当灵敏，可以用来反映地质时期的气候环境变化。', 'e7c13d2017704237bcbb3e37cfcb6bac', '1', '2018-10-10 15:53:04', '1', '2018-10-10 15:53:04', '', '0');
COMMIT;

