BEGIN;
INSERT INTO `z_news` VALUES ('香港一巴士侧翻致19死18伤 司机被控19项误杀罪', 'http://dingyue.nosdn.127.net/gR7z6BvXJbg9YzqgMRT5JCxpuwO5wEP1UHhEYBzbGjQmV1539154341447.jpg', '控罪指出，被告陈浩明于今年2月10日，身为一辆巴士司机，对19名死者的安全负有照顾责任，但他驾驶巴士从沙田马场巴士总站到大埔中心巴士总站时，没采取谨慎措施，即在大埔公路下坡行车道近大埔尾村巴士站前右弯开始，渐渐加速并以过高速度右转，又没有煞车，最终巴士翻侧并撞到大埔尾村巴士站上盖。而因为被告严重疏忽，最终导致15男4女非法被杀。他另被控同日危险驾驶巴士，致18名乘客身体受严重伤害。', '2475b5018096497ebba28f9147f684fe', '1', '2018-10-10 16:01:03', '1', '2018-10-10 16:01:03', '', '0'), ('医院收费员将老人百元钞票推落夹缝 被立案调查', 'http://cms-bucket.nosdn.127.net/2018/10/10/efb026ff627e460c88df5952f47107c1.png', '一名65岁老太太前往南部县王家中心卫生院交钱住院，当递给收费员周某1000元现金后却被告知少了100元。监控显示，收费员在将现金递回给老太太的过程中，将100元现金掉落在桌上，而且收费员用手将这张现金推落到桌子与墙壁的夹缝中。', '37b4055eedc84625a65e78dcf4acad26', '1', '2018-10-10 10:24:29', '1', '2018-10-10 10:30:26', '', '0'), ('女律师称遭警察脱衣检查 媒体:应公开视频平息争议', 'http://cms-bucket.nosdn.127.net/catchpic/9/92/92cb1f092c011907b128a8a41ca73028.jpg', '当事女律师究竟有没有遭到&ldquo;碰瓷&rdquo;执法就目前看，女律师的投诉帖和广州警方的通报各执一端。饶是如此，涉事两方的&ldquo;一事各表&rdquo;，仍提供了丰富细节，这些细节也是还原整个事件始末的拼块。\r\n从双方的说法看，女律师跟有关警员在办事过程中存在冲突。', '4284f2e1dc53470c9d1c89f23b5efa6a', '1', '2018-10-10 16:02:16', '1', '2018-10-10 16:02:16', '', '0'), ('四川达州路面再次塌陷?官方辟谣:工作人员抽水作业', 'http://cms-bucket.nosdn.127.net/2018/10/10/762a47a2ab8e4c8fbd162d6021a4753f.png', '新京报快讯 10月7日，四川达州一道路发声塌陷，4人坠落后遇难。事后，有网友发微博称，达州再次发生路面塌陷事故。10月9日，达州市公安局网络安全保卫支队辟谣称，并无新增塌方，网上视频系工作人员在抽水作业。\r\n\r\n10月7日14时30分左右，四川达州达川区东环南路103号人行道路面发生约10平方米的塌陷，导致4人陷落。截止9日下午3点40分，陷落4人全部找到，均不幸遇难。\r\n\r\n事发后，有网民发微博称，&ldquo;达州南外，前面又塌方了，掉了一辆车。&rdquo;并配有视频。一时间，该微博引发关注。', '612f140a8de7478e8fc2191b830f122b', '1', '2018-10-10 10:31:43', '1', '2018-10-10 10:31:43', '', '0'), ('飓风&ldquo;迈克尔&rdquo;升级为4级风暴 美佛州进入紧急状态', 'http://cms-bucket.nosdn.127.net/catchpic/0/0c/0c8fcc7016dc56675e9ec34451c269d4.jpg', '【环球网综合报道】路透社10月10日消息，迫近美国的飓风&ldquo;迈克尔&rdquo;已经升级为4级风暴。此前，美国总统特朗普已经宣布，由于飓风&ldquo;迈克尔&rdquo;迫近，佛罗里达州进入紧急状态。\r\n俄罗斯卫星通讯社10月10日报道，进入紧急状态意味着联邦政府将应地方政府请求立即提供救灾援助。\r\n出现在墨西哥湾的飓风&quot;迈克尔&quot;已增强为4级飓风，并且正在向佛罗里达海岸移动。', '71543ecf61bf4506bd6ffc96777efeff', '1', '2018-10-10 16:02:56', '1', '2018-10-10 16:02:56', '', '0'), ('日媒：安倍下下周将访华 望将中日关系推至新高度', 'http://cms-bucket.nosdn.127.net/catchpic/4/44/441dab9c0418bbed67842b59f6e5e2d1.png', '安倍称：&ldquo;将会抓住两年一度的亚欧首脑会议这一良好时机，围绕以朝鲜问题为首的国际形势，以及基于自由公正的规则下强化经济秩序等问题，向各国诉说日本的立场。&rdquo;\r\n安倍还表示，自己将于下下周的后半段访问中国。访华期间，将与中国国家领导人进行会谈，不仅会探讨中日关系，还将探讨包括朝鲜问题在内的各种国际形势。并希望能通过此次会谈把中日关系推到新的高度。', 'fe3b0113058742ee96f858fe5f3409e9', '1', '2018-10-10 16:00:19', '1', '2018-10-10 16:00:19', '', '0');
COMMIT;

