BEGIN;
INSERT INTO `z_tec` VALUES ('网易科技讯 10月10日消息', '网易科技讯 10月10日消息，据国外媒体报道，上个月SpaceX宣布日本亿万富翁前泽友作(Yusaku Maezawa)成为其首位参加绕月飞行的乘客。前泽友作在新闻发布会上表示，他之所以能够创办一家价值84亿美元的公司，自身也成为艺术界的一支重要力量，并登上伊隆马&middot;马斯克(Elon Musk)前往月球的火箭，是因为自己工作的时间少，而不是多。', '68760562ec45420a8632efba52a419be', '1', '2018-10-10 14:58:33', '1', '2018-10-10 14:58:33', '', '0'), ('比特大陆葛越晟以34亿财富成&quot;90后&quot;首富', '今年有132位&ldquo;80后&rdquo;上榜，比去年增加32位。其中50位是白手起家的，比去年多11位。浙大校友，新上市的拼 多多38岁黄峥以950亿财富首次成为&ldquo;80后&rdquo;白手起家首富，其次是字节跳动35岁的张一鸣，财富650亿。\r\n\r\n今年上榜的&ldquo;85后&rdquo;有56位，比去年增加20位。其中11位是白手起家的，比去年多5位。比特大陆32岁的吴忌寒首次成为&ldquo;85后&rdquo;白手起家首富，财富165亿。', '908c2748657c4f5a8ced7b29db7d8df8', '1', '2018-10-10 16:05:08', '1', '2018-10-10 16:05:08', '', '0'), ('谷歌不服欧盟反垄断罚款50亿美元判决，已提起上诉', '欧盟委员会在7月份的决议中称，谷歌自2011年就已经开始滥用自己的市场支配地位。目前制造商可以免费安装的安卓系统已经占据了全世界大约80%的智能手机。欧盟市场竞争监管部门称，谷歌的非法行为包含了迫使制造商在手机上预装了谷歌搜索引擎、Chrome浏览器以及Google Play应用商城。', 'c51e2589575a4db6b64eeffbff03cf82', '1', '2018-10-10 14:59:11', '1', '2018-10-10 14:59:11', '', '0'), ('中新经纬客户端10月10日电10月10日，胡润研究院发布2018胡润百富榜名单，马云家族以2700亿登顶中国首富，而恒大董事局主席许家印则以2500亿跌至第二位，腾讯董事局主席兼CEO马化腾以2400亿位居第三。', '中新经纬客户端10月10日电10月10日，胡润研究院发布2018胡润百富榜名单，马云家族以2700亿登顶中国首富，而恒大董事局主席许家印则以2500亿跌至第二位，腾讯董事局主席兼CEO马化腾以2400亿位居第三。\r\n\r\n此外，今年携小米在港交所成功上市的董事长雷军身家大涨，进入百富榜前10，身家达1100亿元。而受到负面消息影响京东董事局主席刘强东身家大幅缩水，以750亿元跌至榜单第24位，今年以来京东股价大跌，曾一夜间股价蒸发逾百亿人民币。', 'd1f0344b36834fceb2faff4af2602681', '1', '2018-10-10 16:05:42', '1', '2018-10-10 16:05:42', '', '0'), ('易读|华为徐直军首谈&quot;达芬奇项目&quot;：为何为AI芯片做全新架构', '网易科技讯 10月10日消息，华为副董事长，轮值董事长徐直军在2018年HC大会上，首次公布了华为人工智能完整战略以及发布了两个基于&ldquo;达芬奇架构&rdquo;的人工智能芯片。\r\n\r\n对于传闻的&ldquo;达芬奇项目&rdquo;，徐直军首次谈起。他表示，之所以不再基于之前的芯片架构，而是做一个全新的架构，是因为目前市场上没有任何架构可以实现全场景覆盖。华为的昇腾系列则可以实现全覆盖。', 'eaf452518ea141ae9288fbc829ed07ef', '1', '2018-10-10 16:06:10', '1', '2018-10-10 16:06:10', '', '0'), ('搜狐CEO张朝阳：我为何向百度与今日头条发起打盗版', '搜狐今日发布维权声明，称百度网盘和今日头条网站中存在大量搜狐视频网络剧《我在大理寺当宠物》侵权盗版内容，搜狐视频已向南京市中级人民法院提起诉讼，目前法院已受理。\r\n\r\n搜狐表示，侵权盗版行为严重侵犯搜狐视频合法权益，请求法院判令百度网盘和今日头条停止侵权，删除全部涉案作品内容并禁止分享，累计赔偿原告经济损失及合理支出1000万元。', 'f9b87e02acc347229a897cc1ccd563b6', '1', '2018-10-10 16:06:28', '1', '2018-10-10 16:06:28', '', '0');
COMMIT;

